 "ManageBetasAction.localization.feature.featureDescription.WORKSPACES": "<p>\u8BE5\u6D4B\u8BD5\u7248\u5F15\u5165\u4E86\u5168\u65B0\u7B80\u5316\u754C\u9762\u5E76\u542F\u7528\u4E86\u4E00\u4E2A\u65B0\u529F\u80FD\uFF0C\u540D\u4E3A <b>Space</b>.</p><p>Space \u662F\u5728\u5370\u8C61\u7B14\u8BB0\u4F01\u4E1A\u7248\u4E2D\u7BA1\u7406\u56E2\u961F\u4FE1\u606F\u66F4\u52A0\u9AD8\u6548\u7684\u65B9\u5F0F\u3002\u4F60\u53EF\u4EE5\u4E3A\u4E00\u4E2A\u9879\u76EE\u3001\u4E00\u4E2A\u56E2\u961F\u6216\u4E00\u4E2A\u8BBA\u9898\u521B\u5EFA\u4E00\u4E2A Space\uFF0C\u5728\u5176\u4E2D\u521B\u5EFA\u7B14\u8BB0\u548C\u7B14\u8BB0\u672C\uFF0C\u5E76\u4E0E\u4F60\u7684\u56E2\u961F\u5206\u4EAB\u3002</p><p>\u56E2\u961F\u7684\u6BCF\u4E2A\u4EBA\u90FD\u53EF\u4EE5\u770B\u5230 Space \u91CC\u5206\u4EAB\u7684\u5185\u5BB9\uFF0C\u627E\u5230\u4ED6\u4EEC\u6240\u9700\u7684\u4FE1\u606F\uFF0C\u8F7B\u677E\u534F\u4F5C,\u5171\u540C\u5B8C\u6210\u5DE5\u4F5C\u3002</p><img src=\"https://i.imgur.com/jMwLmdA.png\" height=\"250px/\" />",
 "ManageBetasAction.localization.feature.help.WORKSPACES": "<b>\u4F7F\u7528\u4E4B\u524D:</b><ul><li>\u8BF7 <a href=\"https://help.evernote.com/hc/en-us/articles/209005257\">\u66F4\u65B0</a> \u5370\u8C61\u7B14\u8BB0 Mac \u548C Windows \u5BA2\u6237\u7AEF\u4FDD\u8BC1\u7248\u672C\u517C\u5BB9\u6027 (\u5E76\u56E2\u961F\u90FD\u9700\u66F4\u65B0)</li><li>\u76EE\u524D\uFF0C\u53EA\u6709Google Chrome\u652F\u6301\u6D4B\u8BD5\u7248\u529F\u80FD</li><li>\u6FC0\u6D3B\u6D4B\u8BD5\u7248\u529F\u80FD\u540E\uFF0C\u53EF\u4EE5\u70B9\u51FB\u5C4F\u5E55\u5DE6\u4E0B\u89D2\u7684\u2018\u53CD\u9988\u2019\u6309\u94AE\u5206\u4EAB\u4F60\u7684\u8BC4\u8BBA</li></ul><img src=\"https://imgur.com/jSfY6G7.png\" height=\"150px\" /><p>\u4E86\u89E3\u66F4\u591A\u5177\u4F53\u64CD\u4F5C\u6307\u5357\u548C\u5E38\u89C1\u95EE\u9898, \u8BF7 <a href=\"https://www.evernote.com/shard/s12/sh/d4cf3271-12d7-4dac-904f-86fc12de6a02/a2b9107dc6e01b4c\">\u70B9\u51FB\u8FD9\u91CC</a></p>",
