 "recoFeedback.text.2": "\u8BF7\u63D0\u4F9B\u6709\u5173\u4F60\u5728\u672C\u7B14\u8BB0\u4E2D\u53D1\u73B0\u7684\u56FE\u50CF\u5904\u7406\u9519\u8BEF\u7684\u63CF\u8FF0\u3002\u4F8B\u5982\uFF0C\u63CF\u8FF0\u4F60\u6240\u9700\u5230\u672C\u7B14\u8BB0\u65F6\u60F3\u627E\u5230\u7684\u6587\u5B57\u3002\u4F60\u7684\u62A5\u544A\u5C06\u5F55\u5165\u4E00\u4E2A\u6570\u636E\u5E93\uFF0C\u800C \u5370\u8C61\u7B14\u8BB0 \u7684\u7814\u53D1\u90E8\u95E8\u5C06\u4F7F\u7528\u6B64\u6570\u636E\u5E93\u6765\u6539\u5584\u6211\u4EEC\u7B97\u6CD5\u7684\u8D28\u91CF\u3002",
 "recoFeedback.text.3": "<strong>\u6CE8\u610F</strong>\uFF1A\u4E0D\u7528\u4F7F\u7528\u6B64\u8868\u5355\u5411\u5370\u8C61\u7B14\u8BB0\u8BF7\u6C42\u76F4\u63A5\u5E2E\u52A9\u3002\u4F60\u5728\u6B64\u8868\u5355\u4E2D\u8F93\u5165\u7684\u4EFB\u4F55\u4E1C\u897F\u90FD\u4E0D\u4F1A\u6536\u5230\u56DE\u590D\u3002\u5982\u679C\u8981\u5BFB\u6C42\u5E2E\u52A9\uFF0C\u8BF7\u63D0\u4EA4\u4E00\u4EFD\u5355\u72EC\u7684<a href=\"/about/contact/support/\">\u6280\u672F\u652F\u6301\u8BE2\u95EE</a>\u3002",
 "recoFeedback.messageInfo": "\u63CF\u8FF0",
 "recoFeedback.note": "\u6B64\u6D88\u606F\u5C06\u8FDE\u540C\u4E00\u4EFD\u4F60\u7B14\u8BB0\u7684\u526F\u672C\u4E00\u8D77\u53D1\u9001\u5230 \u5370\u8C61\u7B14\u8BB0\u3002",
 "recoFeedback.invalidNote.text": "\u4F60\u5C1D\u8BD5\u62A5\u544A\u7684\u7B14\u8BB0\u5DF2\u4E0D\u5B58\u5728\uFF0C\u6216\u8005\u8FDB\u5165\u6B64\u7B14\u8BB0\u65F6\u51FA\u9519\u3002",
 "recoFeedbackDone.text": "\u611F\u8C22\u4F60\u63D0\u4F9B\u6709\u5173\u5370\u8C61\u7B14\u8BB0\u56FE\u50CF\u5904\u7406\u7684\u53CD\u9988\u4FE1\u606F\u3002\u6211\u4EEC\u5C06\u5229\u7528\u4F60\u7684\u53CD\u9988\u6765\u5E2E\u52A9\u6539\u8FDB\u6211\u4EEC\u4ECA\u540E\u7684\u5904\u7406\u5E93\u3002\u9664\u975E\u6211\u4EEC\u9700\u8981\u6709\u5173\u6B64\u9519\u8BEF\u7684\u66F4\u591A\u4FE1\u606F\uFF0C\u5426\u5219\u4F60\u4E0D\u4F1A\u6536\u5230\u6709\u5173\u4F60\u7B14\u8BB0\u7684\u76F4\u63A5\u56DE\u590D\u3002",
